import React from "react";

const AboutSkill = ({ mySkill }) => {
  return (
    <>
      <div className="skills">
        {mySkill.map((e) => {
          return (
            <div className="progress">
              <h3>
                web design <span>95%</span>
              </h3>
              <div className="bar">
                <span></span>
              </div>
            </div>
          );
        })}

        <div className="progress">
          <h3>
            web development <span>70%</span>
          </h3>
          <div className="bar">
            <span></span>
          </div>
        </div>
        <div className="progress">
          <h3>
            uI design <span>95%</span>
          </h3>
          <div className="bar">
            <span></span>
          </div>
        </div>
        <div className="progress">
          <h3>
            SEO marketing <span>20%</span>
          </h3>
          <div className="bar">
            <span></span>
          </div>
        </div>
      </div>
    </>
  );
};

export default AboutSkill;
